import { useNavigation } from "@react-navigation/native";
import React from "react";
import { View, Text, Button } from "react-native";

const CrearPrestamoScreen = (props) => {
  const {navigation} = props;

  const handleGoBack = () => {
    navigation.goBack()
  }
  return (
    <View>
      <Text>Crear Préstamo</Text>
      <Button onPress={handleGoBack} title="Volver" />
      {/* Lógica para crear un préstamo */}
    </View>
  );
};

const EditarMaterialScreen = () => {
  const navigation = useNavigation();
  return (
    <View>
      <Text>Editar Material</Text>
      {/* Lógica para crear un préstamo */}
      <Button onPress={handleGoBack} title="Volver" />
    </View>
  );
};

const EliminarScreen = () => {
  const navigation = useNavigation();
  return (
    <View>
      <Text>Eliminar material</Text>
      {/* Lógica para crear un préstamo */}
      <Button onPress={handleGoBack} title="Volver" />
    </View>
  );
};

export { CrearPrestamoScreen, EditarMaterialScreen, EliminarScreen };
